}
.is-hidden {
  opacity: 0;
  pointer-events: none;
}
// ----------------------------
.modal-fr {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 90vw;
  height: 600px;
  background: $cl-white-primary;
  box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.12), 0px 1px 1px rgba(0, 0, 0, 0.14),
    0px 2px 1px rgba(0, 0, 0, 0.2);
  border-radius: 20px;
  overflow: auto;
  z-index: 9;
  &::before {
    content: '';
    display: block;
    position: absolute;
    background-image: url(../images/mobile/hero-ice@1x.png);
    background-size: cover;
    height: 100%;
    width: 230px;
    background-repeat: no-repeat;
    left: 10%;
    top: 0;
    opacity: 0.4;
    z-index: -1;
    overflow: hidden;
    @media (min-device-pixel-ratio: 2),
      (-webkit-min-device-pixel-ratio: 2),
      (min-resolution: 192dpi),
      (min-resolution: 2dppx) {
      background-image: url(../images/mobile/hero-ice@2x.png);
    }
  }
  @include tel {
    width: 450px;
    height: 570px;
  }

  @include tab {
    width: 500px;
  }

  @include pc {
    max-height: 700px;
  }
}
.buttonClose-fr {
  position: absolute;
  right: 3%;
  top: 2%;
  min-width: 30px;
  min-height: 30px;
  border: 1px solid rgba(0, 0, 0, 0.1);
  border-radius: 50%;
  cursor: pointer;
  background-color: $cl-accent;
  color: $cl-white-primary;
  padding: 6px;
  margin: 0;
  display: flex;
  justify-content: center;
  transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1),
    color 250ms cubic-bezier(0.4, 0, 0.2, 1);
  &:hover {
    color: $cl-accent;
    background-color: $cl-white-primary;
  }
}
.modal-window-fr {
  padding: 20px;
  margin-left: auto;
  margin-right: auto;
}
.modal-window__title-fr {
  font-family: 'Titan One', cursive;
  font-size: 16px;
  font-weight: 500;
  line-height: 1.5;
  letter-spacing: 0.03em;
  margin-bottom: 12px;
  text-align: center;
  padding-top: 30px;
  color: $cl-accent;
  @include pc {
    line-height: 1.15;
  }
}
.modal-window__labels-fr {
  margin-bottom: 4px;
  font-size: 12px;
  line-height: 1.17;
  color: $cl-accent;
}
.modal-window__input-fr {
  width: 100%;
  max-height: 40px;
  display: inline-block;
  font-size: 12px;
  color: $cl-accent;
  border: 1px solid rgba(33, 33, 33, 0.2);
  border-radius: 4px;
  padding: 11px 42px;
  cursor: pointer;
  transition: border-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
