sources.sass/layouts/_header.scss:
//  кнопка скрол вгору
.scrollTop {
  position: fixed;
  bottom: 800px;
  width: 45px;
  height: 45px;
  background: url(./../images/top.png);
  border-radius: 25%;
  background-position: center;
  background-repeat: no-repeat;
  cursor: pointer;
  z-index: 100;
  visibility: hidden;
  opacity: 0;
  transition: 250ms;

  &.active {
    visibility: visible;
    opacity: 0.5;

    @media screen and (max-width: 1279px) {
      background-size: 30px;
      width: 30px;
      height: 30px;
      bottom: 30px;
      right: 30px;
    }

    @media screen and (min-width: 1280px) {
      background-size: 45px;
      width: 45px;
      height: 45px;
      bottom: 50px;
      right: 45px;
    }

    &:hover,
    &:focus {
      opacity: 0.8;
      box-shadow: 0px 5px 10px 5px rgba(212, 20, 67, 0.5);
    }
  }
}

//===== шапка cайту =====
.header__section {
  position: relative;
  display: flex;
  align-items: center;
  flex-direction: row;
  flex-wrap: nowrap;
  justify-content: center;
}
.header {
  @include font-design(DM Sans, normal, 700, 16px, 1.28, 0.04em);
  background-color: $cl-section-hero;
  color: #fff;
}
// ==== логотип ====
.header__logo {
  position: absolute;
  width: 199px;
  height: 50px;

  @media screen and (max-width: 767px) {
    top: 6px;
    left: 20px;
    transform: translateY(-50%);
  }
  @media screen and (min-width: 768px) {
    top: 37px;
    left: 35px;
    transform: translateY(-50%);
  }
  @media screen and (min-width: 768px) {
    top: 37px;
    left: 45px;
    transform: translateY(-50%);
  }
  &:focus {
    outline: none;
  }
}

// === панель навігації ===
.nav {
  &__bar {
    position: absolute;
    top: 50px;
    left: 50%;
    transform: translateX(-50%);
    z-index: 3;

    @media screen and (max-width: 767px) {
      display: none;
    }
  }

  &__item {
    margin-right: 35px;

    &:last-child {
      margin-right: 0;
    }
  }

  &__link {
    display: flex;
    align-items: center;
    color: $cl-white-primary;
    transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);

    &:hover,
    &:focus {
      color: $cl-accent;
      text-shadow: 0px 5px 5px rgba(212, 20, 67, 0.6);
      outline: none;
    }
  }
}
.site-menu {
  display: flex;
  align-items: center;
  flex-direction: row;
  flex-wrap: nowrap;
  color: $cl-white-primary;

  @media screen and (min-width: 320px) and (max-width: 1279px) {
    display: none;
  }
}

//  == мобільне меню ==
.mob {
  &-menu {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    padding: 60px 0 0;
    position: fixed;
    top: 0;
    right: 0;
    width: 250px;
    height: 100vh;
    z-index: 9;
    background-color: $cl-menu-bg;
    box-shadow: -8px 0px 20px rgba(0, 0, 0, 0.25);
    transform: translate(0);
    transition: transform 400ms cubic-bezier(0.4, 0, 0.2, 1),
      opacity 400ms cubic-bezier(0.4, 0, 0.2, 1);

    &.is-hidden {
      transform: translate(100%);
    }

    @include tab {
      justify-content: space-between;
      width: 254px;
      height: 100vh;
    }
  }

  &-menu__open {
    display: block;
    position: absolute;
    margin-left: auto;
    cursor: pointer;
    background: transparent;
    border: none;
    z-index: 3;

    @media screen and (max-width: 767px) {
      top: 32px;
      right: 20px;
      transform: translateY(-50%);
    }
    @include tab {
      top: 52px;
      right: 224px;
    }

    @media screen and (min-width: 1280px) {
      display: none;
    }
  }

  &-menu__close {
    display: block;
    margin-left: auto;
    cursor: pointer;
    position: absolute;
    top: 17px;
    right: 21px;
    background: transparent;
    border: none;
  }
}
.icon-cross {
  fill: #fff;
}
.mob-nav {
  position: relative;
  &__item {
    @include font-design(DM Sans, normal, 700, 14px, 1.28, 0.04em);
    display: flex;
    box-sizing: border-box;
    align-items: center;
    height: 42px;
    border-bottom: 0.5px solid #e18298;

    &:first-child {
      border-top: 1px solid #e18298;
    }
    &:hover,
    &:focus {
      color: $cl-accent;
      box-shadow: 0px 0px 4px 0px rgb(0 0 0 / 25%);
      transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);
    }
  }

  &__link {
    display: flex;
    align-items: center;
    margin-left: 21px;
    width: 100%;
    position: relative;
    color: $cl-white-primary;
    transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);

    @include tab {
      display: flex;
      align-items: center;
      margin-left: 24px;
    }
  }
}

//  === кнопки ===
.btn__buy {
  display: flex;
  justify-content: center;
  align-items: center;
  cursor: pointer;
  background-color: $cl-white-primary;
  border-style: none;
  border-radius: 22px;
  transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);

  @media screen and (max-width: 767px) {
    display: none;
  }

  @include tab {
    position: absolute;
    top: 39px;
    right: 26px;
    width: 160px;
    height: 44px;
  }

  @media screen and (min-width: 1280px) {
    top: 39px;
    right: 115px;
    width: 159px;
    height: 44px;
  }

  &:hover,
  &:focus {
    background-color: $cl-hover-bg2;
    text-shadow: 0px 5px 5px rgba(212, 20, 67, 0.6);
    transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);
    outline: none;
  }

  &-link {
    @include font-design(DM Sans, normal, 700, 16px, 1.31, 0.04em);
    color: $cl-accent;

    &:focus {
      outline: none;
    }
  }
}

.btn__buy-icon {
  margin-left: 12px;
  margin-right: 1px;
}

.btn__buy-mob {
  display: flex;
  justify-content: center;
  align-items: center;
  margin-bottom: 19px;
  margin-left: auto;
  margin-right: auto;
  background-color: $cl-white-primary;
  border-style: none;
  border-radius: 22px;
  transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);

  @media screen and (min-width: 320px) and (max-width: 767px) {
    width: 205px;
    height: 44px;
  }

  @include tab {
    width: 186px;
    height: 44px;
  }

  &:hover,
  &:focus {
    background-color: $cl-hover-bg2;
    text-shadow: 0px 5px 5px rgba(212, 20, 67, 0.6);
    transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);
    outline: rgba(212, 20, 67, 0.6);
  }
}

sources.sass/layouts/_hero.scss:
.hero__section {
  background-color: $cl-section-hero;
  overflow: hidden;

  padding-top: 193px;
  padding-bottom: 160px;

  @include tab {
    padding-top: 102px;
    padding-bottom: 34px;
  }

  @include pc {
    padding-top: 171px;
    padding-bottom: 56px;
  }
}

.hero__container {
  position: relative;
  z-index: 0;

  @include tab {
    display: flex;
    justify-content: space-between;

    padding-left: 34px;
    padding-right: 34px;
  }

  @include pc {
    padding-left: 115px;
    padding-right: 115px;
  }
}

// ------------------------------------ HERO LEFT PART ----------------------------------

.hero__left-part {
  @include tab {
    display: flex;
    flex-direction: column;

    width: 234px;
  }

  @include pc {
    width: 380px;
  }
}

.page-title {
  width: 218px;

  font-family: 'Titan One', cursive;
  font-size: 26px;
  line-height: 1.15;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $cl-white-primary;

  margin-bottom: 19px;

  @include tab {
    width: 162px;
    padding-top: 6px;

    font-size: 22px;
    line-height: 1.14;

    margin-bottom: 20px;
  }

  @include pc {
    width: 277px;

    font-size: 38px;
    line-height: 1.16;

    margin-bottom: 25px;
  }
}
.page-title-accent {
  font-size: 48px;
  line-height: 0.96;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $cl-accent;

  @include tab {
    font-size: 34px;
    line-height: 0.91;
  }

  @include pc {
    font-size: 58px;
    line-height: 0.9;
  }
}

.hero__nav-list {
  display: flex;

  @include tab {
    margin-bottom: 66px;
  }

  @include pc {
    margin-bottom: 112px;
  }
}
.hero__nav-item:not(:first-child) {
  margin-left: 8px;

  @include pc {
    margin-left: 15px;
  }
}
.hero__first-nav-link,
.hero__second-nav-link {
  // reset
  text-decoration: none;
  // reset

  display: flex;
  align-items: center;
  justify-content: center;
  width: 62px;
  height: 24px;

  font-family: 'DM Sans', sans-serif;
  font-size: 8px;
  line-height: 1.25;
  color: $cl-white-primary;

  @include pc {
    width: 104px;
    height: 40px;

    font-size: 14px;
    line-height: 1.28;
  }

  border-radius: 20px;
  background-color: $cl-accent;
  outline: 1px solid transparent;

  transition: background-color 250ms linear, outline 250ms linear;

  &:hover,
  &:focus,
  &:active {
    background-color: $cl-hover-bg1;
    outline-color: $cl-white-primary;
    -webkit-tap-highlight-color: transparent;
    text-shadow: 0px 5px 5px rgba(212, 20, 67, 0.6);
  }
}
.hero__second-nav-link {
  width: 83px;

  @include pc {
    width: 138px;
  }

  color: $cl-accent;

  background-color: $cl-white-primary;
  outline: 1px solid $cl-accent;

  transition: background-color 250ms linear, outline 250ms linear;

  &:hover,
  &:focus,
  &:active {
    background-color: $cl-hover-bg2;
    outline-color: $cl-hover-bg1;
    -webkit-tap-highlight-color: transparent;
  }
}

.hero__add-info {
  display: none;

  @include tab {
    display: block;
    width: 114px;
    align-self: flex-end;
  }

  @include pc {
    width: 200px;
  }
}
.hero__text {
  font-family: 'DM Sans', sans-serif;
  font-size: 8px;
  line-height: 1.5;
  color: $cl-white-primary;

  margin-bottom: 7px;

  @include pc {
    font-size: 14px;
    line-height: 1.4;

    margin-bottom: 20px;
  }
}
.hero__btn {
  display: flex;
  justify-content: center;
  align-items: center;

  // reset
  padding: 0;
  border: none;
  background-color: transparent;
  // reset

  border-radius: 50%;
  outline: 1px solid transparent;

  transition: outline 250ms linear;

  &:hover,
  &:focus,
  &:active {
    cursor: pointer;
    outline-color: $cl-hover-bg1;
  }
}
.hero__btn-icon {
  width: 18px;
  height: 18px;

  @include pc {
    width: 26px;
    height: 26px;
  }
}

// ------------------------------------ HERO RIGHT PART -----------------------------------

.hero__right-part {
  display: none;

  @include tab {
    display: block;
  }
}
.hero__stat-item {
  display: flex;
  flex-direction: column;

  &:not(:last-child) {
    margin-bottom: 14px;
  }

  @include pc {
    margin-bottom: 18px;
  }
}
.hero__stat-number {
  position: relative;

  font-family: 'Titan One', cursive;
  font-size: 28px;
  line-height: 1.14;
  letter-spacing: 0.04em;
  text-align: right;
  text-transform: uppercase;
  color: $cl-accent;

  @include pc {
    font-size: 46px;
    line-height: 1.15;
  }

  &::after {
    position: absolute;
    top: -2px;
    right: -6px;
    z-index: -1;

    content: '';
    width: 16px;
    height: 16px;
    border-radius: 50%;
    background-color: $cl-white-primary;

    @include pc {
      top: -5px;
      right: -16px;

      width: 30px;
      height: 30px;
    }
  }
}
.hero__stat-text {
  font-family: 'DM Sans', sans-serif;
  font-size: 8px;
  line-height: 1.25;
  text-align: right;
  color: $cl-white-primary;

  @include pc {
    font-size: 14px;
    line-height: 1.28;
  }
}

// ---------------------------------------- HERO IMAGES ---------------------------------------

.hero__img-1 {
  position: absolute;
  bottom: -160px;
  left: calc(11.25vw * 2 - 36px + 81px);
  z-index: -1;

  width: 171px;
  height: 410px;

  @include tel {
    left: 153px;
  }

  @include tab {
    left: 378px;
    bottom: -34px;

    width: 143px;
    height: 336px;
  }

  @include pc {
    left: 594px;
    bottom: -56px;

    width: 236px;
    height: 557px;
  }
}
.circle {
  position: absolute;
  bottom: -85px;
  left: calc(11.25vw * 2 - 36px);
  z-index: -2;

  width: 346px;
  height: 344px;
  border-radius: 50%;
  background-color: $cl-primary;

  @include tel {
    left: 72px;
  }

  @include tab {
    left: 307px;
    bottom: 12px;

    width: 324px;
    height: 322px;
  }

  @include pc {
    left: 475px;
    bottom: 19px;

    width: 538px;
    height: 538px;
  }
}

.hero__img-2 {
  display: none;

  @include tab {
    display: block;

    position: absolute;
    bottom: -6px;
    left: 34px;
    z-index: -1;

    width: 124px;
    height: 126px;
  }

  @include pc {
    bottom: -11px;
    left: 77px;

    width: 188px;
    height: 191px;
  }
}
.hero__img-3 {
  display: none;

  @include tab {
    display: block;

    position: absolute;
    bottom: -34px;
    right: 34px;
    z-index: -1;

    width: 168px;
    height: 133px;
  }

  @include pc {
    bottom: -56px;
    right: 109px;

    width: 293px;
    height: 232px;
  }
}

sources.sass/layouts/_products.scss:
// ----------------MAIN---------------------- //
.container__products {
  padding-top: 115px;
  padding-bottom: 98px;

  text-align: center;

  @include tab {
    padding-top: 122px;
    padding-bottom: 112px;
  }

  @include pc {
    padding-top: 127px;
    padding-bottom: 120px;
    padding-right: 113px;
    padding-left: 113px;
  }
}

// -------------Header Part----------------- //
.products__main-header {
  font-family: Titan One;
  font-size: 34px;
  line-height: 1.14;
  text-align: center;
  letter-spacing: 0.04em;
  color: $cl-accent;
  margin-bottom: 144px;

  @include tab {
    margin-bottom: 150px;
  }

  @include pc {
    font-size: 58px;
    margin-bottom: 260px;
  }
  &-description {
    margin-bottom: 15px;
    font-family: Titan One;
    font-size: 18px;
    line-height: 1.14;
    text-align: center;
    letter-spacing: 0.04em;
    color: $cl-primary;

    @include pc {
      font-size: 30px;
    }
  }
}

// ------------------ Product Cards ------------------ //
.products-block {
  display: flex;
  flex-direction: column;
  justify-items: center;
  align-items: center;
  margin-bottom: -130px;

  @include tab {
    flex-direction: row;
    margin-right: -20px;
    margin-bottom: 0;
  }
}
.products-card {
  display: flex;
  flex-direction: column;
  position: relative;
  height: 485px;
  width: 280px;

  margin-bottom: 130px;
  padding-top: 161px;
  padding-bottom: 41px;
  padding-right: 42px;
  padding-left: 42px;
  text-align: center;
  color: $cl-white-primary;

  border-radius: 24px;

  @include tab {
    padding-top: 150px;
    padding-right: 15px;
    padding-left: 15px;

    margin-right: 20px;
    margin-bottom: 0;

    width: 220px;
    height: 485px;
  }
  @include pc {
    padding-top: 165px;
    padding-bottom: 50px;
    padding-left: 44px;
    padding-right: 44px;

    width: 330px;
    height: 525px;
  }

  // -----------------Dote------------- //
  &::after {
    display: flex;
    position: absolute;
    content: '';
    top: 220px;
    left: 45%;
    background-image: url(./../images/dotes@2x-min.png);
    width: 26px;
    height: 6px;

    @include tab {
      top: 205px;
    }
    @include pc {
      top: 230px;
    }
    //  -------------------------------- //
  }
}
// ------------ Decorative Pictures --------------- //
.products-card--bg {
  &-pink {
    background-color: $cl-card1;

    &::before {
      position: absolute;
      content: '';
      width: 250px;
      height: 250px;
      top: -113px;
      left: 7%;
      background-image: url(./../images/mobile/ice-cream@2x.png);
      background-repeat: no-repeat;
      background-size: contain;

      @include tab {
        width: 220px;
        height: 238px;
        left: 0%;
      }

      @include pc {
        width: 335px;
        height: 335px;
        top: -210px;
      }
    }
  }
  &-bezh {
    background-color: $cl-card2;

    &::before {
      position: absolute;
      content: '';
      width: 250px;
      height: 250px;
      top: -113px;
      left: 7%;
      background-image: url(./../images/mobile/ice-coffe@2x.png);
      background-repeat: no-repeat;
      background-size: contain;

      @include tab {
        width: 220px;
        height: 238px;
        left: 0%;
      }

      @include pc {
        width: 335px;
        height: 335px;
        top: -210px;
      }
    }
  }

  &-green {
    background-color: $cl-card3;

    &::before {
      position: absolute;
      content: '';
      width: 250px;
      height: 250px;
      top: -113px;
      left: 7%;
      background-image: url(./../images/mobile/milkshakes@2x.png);
      background-repeat: no-repeat;
      background-size: contain;

      @include tab {
        width: 220px;
        height: 238px;
        left: 0%;
      }
      @include pc {
        width: 335px;
        height: 335px;
        top: -210px;
      }
    }
  }
}
// ---------------------------------------------------------------- //

//  -------------------- Inside Product Cards --------------------- //
.products-card__header--text {
  display: block;

  margin-bottom: 66px;

  font-family: Titan One;
  font-weight: 400;
  letter-spacing: 0.04em;
  font-size: 20px;
  line-height: 1.15;
  text-align: center;

  @include pc {
    font-size: 30px;
    margin-bottom: 64px;
  }
}

.products-card__description {
  margin-bottom: 30px;

  font-weight: bold;
  font-size: 14px;
  line-height: 1.5;

  @include tab {
    margin-bottom: 40px;
  }
  @include pc {
    font-size: 16px;
    margin-bottom: 62px;
  }
}
.products-card__btn {
  padding: 0;
  border: none;
  background-color: transparent;

  border-radius: 50%;
  outline: none;

  transition: border 250ms linear;

  &:hover,
  &:focus,
  &:active {
    cursor: pointer;
    border: 2px solid #c7133e;
  }

  &--icon {
    width: 40px;
    height: 40px;
  }
}
// ---------------------------------------------------------------- //

sources.sass/layouts/_about.scss:
.about__section {
  padding-top: 125px;
  background-color: $cl-section;

  @media screen and (min-width: 768px) and (max-width: 1279px) {
    padding-top: 130px;
  }

  @media screen and (max-width: 767px) {
    background-image: url(../images/mobile/milk@1x.png);
    background-repeat: no-repeat;
    background-position: bottom 61px left;
    background-size: 100%;
    @media (min-device-pixel-ratio: 2),
      (-webkit-min-device-pixel-ratio: 2),
      (min-resolution: 192dpi),
      (min-resolution: 2dppx) {
      background-image: url(../images/mobile/milk@2x.png);
    }
  }

  @include pc {
    background-image: url(../images/pc/about-milk@1x.png);
    background-repeat: no-repeat;
    background-position: bottom -65px left;
    background-size: 100%;

    @media (min-device-pixel-ratio: 2),
      (-webkit-min-device-pixel-ratio: 2),
      (min-resolution: 192dpi),
      (min-resolution: 2dppx) {
      background-image: url(../images/pc/about-milk@2x.png);
    }
  }
}

.about__container {
  padding-left: 50px;
  padding-right: 50px;

  @include tab {
    padding-left: 39px;
    padding-right: 36px;
  }

  @include pc {
    padding-left: 112px;
    padding-right: 117px;
  }
}

.about__pre-title {
  margin-bottom: 15px;
  @include font-design(Titan One, normal, 400, 18px, 1.17);

  text-align: center;
  text-transform: uppercase;
  color: $cl-primary;

  @include tab {
    margin-bottom: 16px;
    @include font-design(Titan One, normal, 400, 26px, 1.15);
  }

  @include pc {
    margin-bottom: 15px;
    @include font-design(Titan One, normal, 400, 30px, 1.13);
  }
}

.about__title {
  margin: auto;
  margin-bottom: 26px;
  @include font-design(Titan One, normal, 400, 34px, 1.15, 0.04em);

  text-align: center;
  text-transform: uppercase;
  color: $cl-accent;

  @media screen and (max-width: 767px) {
    width: 200px;
  }

  @include tab {
    margin-bottom: 50px;
    @include font-design(Titan One, normal, 400, 48px, 1.14, 0.04em);
  }

  @include pc {
    margin-bottom: 55px;
    @include font-design(Titan One, normal, 400, 58px, 1.14, 0.06em);
  }
}

.about__product {
  @include tab {
    display: flex;
  }
}

.about__thumb {
  width: 100%;
  height: auto;

  @media screen and (max-width: 767px) {
    margin-bottom: 46px;
  }

  @include tab {
    margin-right: 17px;
    flex-basis: calc((100% - 17px) / 2);
  }

  @include pc {
    margin-right: 74px;
    flex-basis: calc((100% + 20px) / 2);
  }
}

.about__description {
  @include tab {
    padding-top: 50px;
    flex-basis: calc((100% - 17px) / 2);
  }

  @include pc {
    padding-top: 51px;
    padding-bottom: 107px;
    flex-basis: calc((100% - 94px) / 2);
  }
}

.about__list {
  margin-bottom: 17px;

  @include tab {
    margin-bottom: 62px;
  }

  @include pc {
    margin-bottom: 45px;
  }
}

.about__item:not(:last-child) {
  margin-bottom: 30px;

  @include pc {
    margin-bottom: 35px;
  }
}
.about__item:nth-child(2) {
  @media screen and (max-width: 1279px) {
    margin-bottom: 15px;
  }
}

.about__text {
  @include font-design(DM Sans, normal, 500, 12px, 1.62);

  color: $cl-text;

  @include tab {
    @include font-design(DM Sans, normal, 500, 14px, 1.76, 0.04em);
  }
  @include pc {
    @include font-design(DM Sans, normal, 500, 14px, 1.94, 0.04em);
  }
}

.about__text--first {
  color: $cl-h-text;

  @include pc {
    @include font-design(DM Sans, normal, 500, 16px, 1.76, 0.04em);
  }
}

.about__btn {
  padding: 0;
  min-width: 176px;
  height: 44px;
  display: flex;
  justify-content: center;
  align-items: center;
  cursor: pointer;

  border-radius: 22px;
  border: transparent;
  fill: currentColor;

  background-color: $cl-white-primary;
  transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);

  &-link {
    color: $cl-accent;
    @include font-design(DM Sans, normal, 700, 14px, 1.29);

    @include tab {
      @include font-design(DM Sans, normal, 700, 16px, 1.31);
      outline: none;
    }
  }

  &:hover,
  &:focus,
  &:active {
    background-color: $cl-hover-bg2;
    text-shadow: 0px 5px 5px rgba(212, 20, 67, 0.6);
    outline: none;
  }
}

.about__btn-icon {
  margin-left: 13px;
}

sources.sass/layouts/_advantages.scss:
.advantage__section {
  padding-top: 39px;
  padding-bottom: 97px;
  background: $cl-section;
  @media screen and (min-width: 768px) and (max-width: 1279px) {
    padding-top: 66px;
    padding-bottom: 140px;
  }
  @media screen and (min-width: 1280px) {
    padding-bottom: 139px;
  }
}

.advantages-list {
  @include tab {
    display: flex;
    flex-wrap: nowrap;
    justify-content: space-between;
  }
}

.advantages-thumb {
  @media screen and (max-width: 767px) {
    max-width: 230px;
  }
  @media screen and (min-width: 768px) and (max-width: 1279px) {
    max-width: 180px;
  }
  @media screen and (min-width: 1280px) {
    max-width: 330px;
  }
}

.advantages-item:not(:last-child) {
  @media screen and (max-width: 767px) {
    margin-bottom: 38px;
  }
  @media screen and (min-width: 768px) and (max-width: 1279px) {
    margin-right: 60px;
  }
  @media screen and (min-width: 1280px) {
    margin-right: 30px;
  }
}

.advantages-numbers {
  font-family: Titan One;
  font-style: normal;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $cl-accent;
  @media screen and (max-width: 767px) {
    font-size: 36px;
    line-height: 1.13;
    margin-bottom: 13px;
  }
  @media screen and (min-width: 768px) {
    font-size: 48px;
    line-height: 1.14;
    margin-bottom: 13px;
  }
  @media screen and (min-width: 1280px) {
    font-size: 58px;
    line-height: 1.13;
    margin-bottom: 15px;
  }
}

.advantages-thumb__first::before {
  content: '';
  display: inline-block;
  background-size: contain;
  background-repeat: no-repeat;
  width: 33px;
  height: 50px;
  margin-bottom: 16px;
  @media screen and (min-width: 768px) {
    margin-bottom: 36px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 40px;
  }
  background-image: url(../images/bucket@1x-min.png);

  @media (min-device-pixel-ratio: 2),
    (-webkit-min-device-pixel-ratio: 2),
    (min-resolution: 192dpi),
    (min-resolution: 2dppx) {
    .advantages-thumb__first::before {
      background-image: url(../images/bucket@2x-min.png);
    }
  }
}

.advantages-thumb__second::before {
  content: '';
  display: inline-block;
  background-size: contain;
  background-repeat: no-repeat;
  width: 50px;
  height: 50px;
  margin-bottom: 16px;
  @media screen and (min-width: 768px) {
    margin-bottom: 36px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 40px;
  }
  background-image: url(../images/bucket-apples@1x-min.png);

  @media (min-device-pixel-ratio: 2),
    (-webkit-min-device-pixel-ratio: 2),
    (min-resolution: 192dpi),
    (min-resolution: 2dppx) {
    .advantages-thumb__first::before {
      background-image: url(../images/bucket-apples@2x-min.png);
    }
  }
}

.advantages-thumb__third::before {
  content: '';
  display: inline-block;
  background-size: contain;
  background-repeat: no-repeat;
  width: 44px;
  height: 50px;
  margin-bottom: 16px;
  @media screen and (min-width: 768px) {
    margin-bottom: 36px;
  }
  @media screen and (min-width: 1280px) {
    margin-bottom: 40px;
  }
  background-image: url(../images/candy@1x-min.png);

  @media (min-device-pixel-ratio: 2),
    (-webkit-min-device-pixel-ratio: 2),
    (min-resolution: 192dpi),
    (min-resolution: 2dppx) {
    .advantages-thumb__first::before {
      background-image: url(../images/candy@2x-min.png);
    }
  }
}

.advantages-description {
  font-weight: bold;
  color: $cl-h-text;
  @media screen and (max-width: 767px) {
    font-size: 12px;
    line-height: 1.66;
  }
  @media screen and (min-width: 768px) {
    font-size: 14px;
    line-height: 1.71;
  }
  @media screen and (min-width: 1280px) {
    font-size: 16px;
    line-height: 1.75;
    letter-spacing: 0.02em;
  }
}

sources.sass/layouts/_gallery.scss:
.gallery {
  padding-bottom: 80px;

  @include tab {
    padding-bottom: 121px;
  }

  @include pc {
    padding-bottom: 123px;
  }

  background-image: linear-gradient(#fff5f6 30%, #fff 30%);
}

.gallery__container {
  @include small {
