// ---------------------------------------SLIDER------------------------------------

.gallery__backdrop {
  position: fixed;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  z-index: 1;
  background: rgba(0, 0, 0, 0.5);

  transition: opacity 400ms linear;
}
.slider-hidden {
  opacity: 0;
  pointer-events: none;
}
.slick-slider {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);

  width: 90vw;
  @include tab {
    width: 80vw;
  }
  @include pc {
    width: 70vw;
  }
}

.slick-prev {
  @include tel {
    transform: translateX(5px);
  }
  @include tab {
    width: 40px;
    height: 40px;
    transform: translate(-20px, -20px);
    &::before {
      font-size: 40px;
    }
  }
  @include pc {
    width: 60px;
    height: 60px;
    transform: translate(-50px, -30px);
    &::before {
      font-size: 60px;
    }
  }
}
.slick-next {
  @include tel {
    transform: translateX(-5px);
  }
  @include tab {
    width: 40px;
    height: 40px;
    transform: translate(20px, -20px);
    &::before {
      font-size: 40px;
    }
  }
  @include pc {
    width: 60px;
    height: 60px;
    transform: translate(50px, -30px);
    &::before {
      font-size: 60px;
    }
  }
}
.slick-slide {
  margin: 0 5px;
}

.sliderClose {
  border: none;
  background-color: transparent;
  position: absolute;
  z-index: 10;
  right: 2%;
  top: 2%;

  cursor: pointer;
  color: azure;
  fill: currentColor;

  transition: color 250ms linear;

  &:hover {
    fill: #fff;
  }
}

.sliderClose__icon {
  @include tab {
    width: 30px;
    height: 30px;
  }
  @include pc {
    width: 40px;
    height: 40px;
  }
}

